import Sidebar from "../../layout/Sidebar";
import { useEffect } from "react";

function AdminPage() {
  useEffect(() => {
    const scripts = [
      "/assets/js/jquery-3.6.0.min.js",
      "/assets/js/bootstrap/bootstrap.bundle.min.js",
      "/assets/js/icons/feather-icon/feather.min.js",
      "/assets/js/icons/feather-icon/feather-icon.js",
      "/assets/js/scrollbar/simplebar.js",
      "/assets/js/scrollbar/custom.js",
      "/assets/js/customizer.js",
      "/assets/js/config.js",
      "/assets/js/sidebar-menu.js",
      "/assets/js/notify/bootstrap-notify.min.js",
      "/assets/js/notify/index.js",
      "/assets/js/jquery.dataTables.js",
      "/assets/js/custom-data-table.js",
      "/assets/js/checkbox-all-check.js",
      "/assets/js/sidebareffect.js",
      "/assets/js/script.js",
    ];

    const scriptElements = [];

    scripts.forEach((src) => {
      const script = document.createElement("script");
      script.src = src;
      script.async = false; // Giữ thứ tự tải
      document.body.appendChild(script);
      scriptElements.push(script);
    });

    // Cleanup khi component unmount
    return () => {
      scriptElements.forEach((script) => {
        document.body.removeChild(script);
      });
    };
  }, []);
  return (
    <>
      {/* Google font */}
      <link
        href="https://fonts.googleapis.com/css2?family=Public+Sans:ital,wght@0,100;0,200;0,300;0,400;0,500;0,600;0,700;0,800;0,900;1,100;1,200;1,300;1,400;1,500;1,600;1,700;1,800;1,900&display=swap"
        rel="stylesheet"
      />

      {/* CSS assets */}
      <link
        rel="stylesheet"
        type="text/css"
        href="/assets/css/vendors/font-awesome.css"
      />
      <link rel="stylesheet" href="/assets/css/linearicon.css" />
      <link rel="stylesheet" type="text/css" href="/assets/css/remixicon.css" />
      <link
        rel="stylesheet"
        type="text/css"
        href="/assets/css/datatables.css"
      />
      <link
        rel="stylesheet"
        type="text/css"
        href="/assets/css/vendors/themify.css"
      />
      <link
        rel="stylesheet"
        type="text/css"
        href="/assets/css/vendors/feather-icon.css"
      />
      <link
        rel="stylesheet"
        type="text/css"
        href="/assets/css/vendors/scrollbar.css"
      />
      <link
        rel="stylesheet"
        type="text/css"
        href="/assets/css/vendors/animate.css"
      />
      <link
        rel="stylesheet"
        type="text/css"
        href="/assets/css/vendors/bootstrap.css"
      />
      <link rel="stylesheet" type="text/css" href="/assets/css/style.css" />
      <Sidebar />
    </>
  );
}

export default AdminPage;
